package proassign1;

public class demo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		float mul=1;
		float no=2.6f;
		float no1=1.56f;
		for (float i=no;i<=5;i++)
		{
			mul=mul*i;
		}
		System.out.println(mul);
		
		for (float i=no1;i<=5;i++)
		{
			mul=mul*i;
		}
		System.out.println(mul);
	}

}
